import React from "react";
import CourseVideoContent from "./CourseVideoContent";

export default class CourseContainer2 extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      height: 0
    };
  }

  componentDidMount() {}

  onResize = (width, height) => {
    console.log(width, height);
    this.setState({
      height: height
    });
  };

  render() {
    return (
      <CourseVideoContent
        onResize={this.onResize}
        height={this.state.height}
      ></CourseVideoContent>
    );
  }
}
